</button>
<audio autoplay muted id="audio">
    <source src="assets/audio/#.mp3">
</audio>
<style>
    svg {
        opacity :.5;
    }
</style>
<script>
   button.onclick = () => {
     const audio = document.querySelector('audio')
     audio.muted = false
     if(audio.paused){
         audio.play()
         button.innerText="Pause"
     } else {
         audio.pause()
         button.innerText="Play"
     }
   }
</script>
</body>
</html>
